import React from "react";
import { Link } from "react-router-dom";
import "../styles/Navbar.css";

export default function NavbarSimple() {
  return (
    <nav className="navbar simple">
      <Link to="/" className="logo">
        CustomHobby
      </Link>
    </nav>
  );
}
